Blockly.Msg.TOUR1_DESCRIPTION00 = "następny";
Blockly.Msg.TOUR1_DESCRIPTION01 = "Witamy,<br>klikaj  »następny« aby rozejrzeć się po Open Roberta Lab.<br>Zademonstrowane zostanie, w jaki sposób możesz zaprogramować swojego robota za pomocą NEPO.<br>Możesz zakończyć ten samouczek naciskając »X« w prawym górnym rogu.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "Menu ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Tutaj możesz znaleźć wszystko, czego potrzebujesz do zaprogramowania swojego robota!<br><span class=\"typcn typcn-document-text\"></span> Zapisuj i wczytuj programy<br><span class=\"typcn typcn-ev3\"></span> Podłącz swojego robota do Open Roberta Lab lub przełącz na inny system<br><span class=\"typcn typcn-lightbulb\"></span> Pomaga we wszystkich rodzajach problemów<br><span class=\"typcn typcn-user\"></span>Wszystko co dotyczy kont użytkowników, np logowanie i wylogowywanie<br><span class=\"typcn typcn-th-large-outline\"></span> Obejrzyj galerię i wypróbuj programy innych użytkowników!<br><span class=\"typcn typcn-world\"></span> Kliknij tutaj, aby przełączyć na inny język";
Blockly.Msg.TOUR1_DESCRIPTION04 = "Kliknij tutaj aby zmienić konfigurację robota.";
Blockly.Msg.TOUR1_DESCRIPTION05 = "Możesz dopasować konfigurację robota później,<br>jeżeli zbudujesz innego.<br>Jeżeli nie masz robota i chcesz sprawdzić swój program w symulatorze,<br>to taka konfiguracja zostanie użyta.";
Blockly.Msg.TOUR1_DESCRIPTION06 = "Kliknij tutaj aby wrócić do obszaru programowania!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "Narzędzia.<br>Tutaj znajdziesz wszystkie bloki kontrolne programu.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "Gdy zdobędziesz nieco doświadczenia, możesz tu włączyć tryb eksperta.<br>Znajdziesz w nim więcej bloków do programowania swojego robota.<br><span class=\"typcn typcn-media-stop-outline\"></span> początkujący<br><span class=\"typcn typcn-star-outline\"></span> ekspert";
Blockly.Msg.TOUR1_DESCRIPTION08 = "Każdy program zaczyna się od bloku »program start«.<br>Bloki, które robot ma wykonać w następnej kolejności powinny być podczepione do tego bloku.<br>Po prostu przeciągnij i upuść pożądany blok pod blokiem początkowym.";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Tutaj znajdziesz nieco skrótów!<br>Od lewej do prawej:<br><span class=\"typcn typcn-media-play\"></span> Kliknij tutaj, aby uruchomić program na prawdziwym robocie<br><span class=\"typcn typcn-cloud-storage\"></span> Zapisz swój program, ale nim to zrobisz, musisz się zalogować<br><span class=\"typcn typcn-zoom\"></span> Kliknij tutaj i powększ bloki, jeżeli chcesz<br><span class=\"typcn typcn-archive\"></span> Kosz na śmieci! Przesuń bloki do kosza i zostaną skasowane.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Uwaga: Skasowanych bloków nie można odzyskać!<br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "Naciśnij »Działania«";
Blockly.Msg.TOUR1_DESCRIPTION12 = "Teraz przeciągnij nowy blok poniżej bloku początkowego, aby połączyły się ze sobą";
Blockly.Msg.TOUR1_DESCRIPTION13 = "Teraz otwórz symuację...";
Blockly.Msg.TOUR1_DESCRIPTION13a = "i sprawdź swój program w symulatorze!";
Blockly.Msg.TOUR1_DESCRIPTION15 = "Doskonale,<br>Twój robot jedzie do przodu przez 20 cm,<br>to jest program, który napisałeś/aś!";
Blockly.Msg.TOUR1_DESCRIPTION16 = "Do zobaczenia i baw się dobrze!";
